// Brutal Quizlet
// Variables

const rounds_in_clip = document.querySelector(".StudentPlayingHeader-progress");
const pistol = document.querySelector(".StudentPlayingHeader-teamName");

// Image data

const pistol_src = "data:image/png;base64,";

// Functions 

function initText () {
  rounds_in_clip.innerText = rounds_in_clip.innerText.replace(" rounds left in clip.", "");
  rounds_in_clip.innerText = rounds_in_clip.innerText + " rounds left in clip.";
  
  pistol.innerHTML = "<img src='" + pistol_src + "' width='100' height='25'/> Carbine";
}

// Begin brutalizing the page

pistol.style.display = "flex";
setInterval(initText, 1000);
